import React from 'react';
import { IonSlide, IonCard, IonCardTitle } from '@ionic/react';

const SlideShow = () => {
    const slides = [
        {
            id: 0
        },
        {
            id: 1
        },
        {
            id: 2
        }
    ]
    return (
        <IonSlides>
            {
                slides.map(slide => (
                    <IonSlide key={id}>
                        <IonCard>
                            <IonCardTitle>
                                {id}
                            </IonCardTitle>
                        </IonCard>
                    </IonSlide>
                ))
            }
        </IonSlides>
    );
}

export default SlideShow;
